pragma solidity >=0.4.0 <0.6.0;
pragma experimental ABIEncoderV2;


contract RentSpatialNode {
    // Contact information of node owners.
    struct Actor {
        address publicAddress;
        string ipAdress;
        uint port;
        uint priority;
    }

    // RentedNode holds complete information about a node rental.
    struct RentedNode {
        Actor owner;
        uint startTime; // POSIX time.
        uint endTime;
    }

    // Specific priorities for actors in the network.
    mapping(address => uint) priorities;

    // Maps coordinates to list of bookings.
    mapping(bytes => RentedNode[]) rentedNodes;

    address private contractOwner;

    // Set the deployer of the contract to be contract owner.
    constructor() public {
        contractOwner = msg.sender;
    }

    // The contract owner can set priority for addresses. Any addresses
    // that does not have an explicit priority gets the default 0.
    function SetPriority(address _address, uint _priority) public {
        require(msg.sender == contractOwner, "Only contract owner can set priority.");
        priorities[_address] = _priority;
    }

    // CheckAvailable checks if the given node is currently available for the.
    function CheckAvailable(int _x, int _y, int _z, uint _start, uint _end) public view returns(bool) {
        bytes memory key = abi.encode(_x, _y, _z);

        for (uint i = 0; i < rentedNodes[key].length; i++) {
            RentedNode memory currentNode = rentedNodes[key][i];

            // If the requested start or end times are contained in another booking, the requested time is not avilable.
            if ((_start >= currentNode.startTime    && _start < currentNode.endTime)    ||
                (_end > currentNode.startTime       && _end <= currentNode.endTime)     ||
                (_start <= currentNode.startTime    && _end >= currentNode.endTime)) {
                return false;
            }
        }

        // If the loop completed, the node is available for the requested time.
        return true;
    }

    // UpdateNode removes the given node if the time has expired.
    function UpdateNode(int _x, int _y, int _z) private {
        bytes memory key = abi.encode(_x, _y, _z);

        // Loop over bookings of given node and remove any expired.
        for (uint i = 0; i < rentedNodes[key].length; i++) {
            if (now > rentedNodes[key][i].endTime) {
                // Order does not matter, replace element to remove with last element
                // and delete last element to reduce size and avoid gaps.
                rentedNodes[key][i] = rentedNodes[key][rentedNodes[key].length-1];
                delete rentedNodes[key][rentedNodes[key].length-1];
                rentedNodes[key].length--;
            }
        }
    }

    event Success(bool success);

    // Rent attempts to rent a node if available.
    function RentNode(int _x, int _y, int _z, uint _start, uint _duration, string memory _ip, uint _port) public {
        // If the given start time has passed, use the current time instead.
        if (_start < now) {
            _start = now;
        }
        uint endTime = _start + _duration;

        // Update the node to clear memory.
        UpdateNode(_x, _y, _z);

        if(!CheckAvailable(_x, _y, _z, _start, endTime)) {
            emit Success(false);
        } else {
            /*
                If this should cost money, charge here.
            */
            rentedNodes[abi.encode(_x, _y, _z)].push(RentedNode(Actor(msg.sender, _ip, _port, priorities[msg.sender]), _start, endTime));
            emit Success(true);
        }
    }

    // GetOwner returns the information of the current owner.
    function GetOwner(int _x, int _y, int _z) public view returns (Actor memory) {
        bytes memory key = abi.encode(_x, _y, _z);

        Actor memory owner = Actor(address(0), '', 0, 0);

        // Search through bookings of the given node to find the current owner.
        for (uint i = 0; i < rentedNodes[key].length; i++) {
            RentedNode memory currentNode = rentedNodes[key][i];
            if (currentNode.startTime <= now && currentNode.endTime >= now) {
                owner = currentNode.owner;
                break;
            }
        }
        return owner;
    }

    // GetEndTime returns the end time of the current rental,
    // if none, returns 0.
    function GetEndTime(int _x, int _y, int _z) public view returns (uint) {
        bytes memory key = abi.encode(_x, _y, _z);

        for (uint i = 0; i < rentedNodes[key].length; i++) {
            RentedNode memory currentNode = rentedNodes[key][i];
            if (currentNode.startTime < now && currentNode.endTime > now) {
                return currentNode.endTime;
            }
        }
        return 0;
    }

    // Changes the owner of a node for the remainder of the rental period.
    // Requires that the current owner requests the change.
    function ChangeOwner(int _x, int _y, int _z, address _newOwner, string memory _ip, uint _port) public {
        uint ownerIndex = 0;
        bool foundOwner = false;

        // Find the current owner of the given node.
        bytes memory key = abi.encode(_x, _y, _z);
        for (uint i = 0; i < rentedNodes[key].length; i++) {
            RentedNode memory currentNode = rentedNodes[key][i];
            if (currentNode.startTime < now && currentNode.endTime > now) {
                ownerIndex = i;
                foundOwner = true;
                break;
            }
        }
        // Change owner if owner is found and sender is owner. Emit event to let client know the result.
        if (foundOwner && msg.sender == rentedNodes[key][ownerIndex].owner.publicAddress) {
          rentedNodes[key][ownerIndex].owner = Actor(_newOwner, _ip, _port, priorities[_newOwner]);
          emit Success(true);
        }
        else {
          emit Success(false);
        }
    }

    // Adds time to an existing rental, used after node exchange.
    function AddTimeToRental(int _x, int _y, int _z, uint _duration) public {
        bytes memory key = abi.encode(_x, _y, _z);

        uint rentalIndex = 0;
        bool foundRental = false;

        // Find the current active rental of the given node.
        for (uint i = 0; i < rentedNodes[key].length; i++) {
            RentedNode memory currentNode = rentedNodes[key][i];
            if (currentNode.startTime < now && currentNode.endTime > now) {
                foundRental = true;
                rentalIndex = i;
                break;
            }
        }
        // Add time if rental found and sender is owner. Emit event to let client know the result.
        if (foundRental && msg.sender == rentedNodes[key][rentalIndex].owner.publicAddress) {
          rentedNodes[key][rentalIndex].endTime += _duration;
          emit Success(true);
        }
        else {
          emit Success(false);
        }
    }
}
